            "title": "$:/language/Help/unpackplugin",
            "description": "Extrair tiddlers de conteúdo de uma extensão",
            "text": "Extrai o conteúdo de uma extensão, recriando-o como tiddlers vulgares:\n\n```\n--unpackplugin <título>\n```\n"
